/*!

=========================================================
* Paper Kit React - v1.3.1
=========================================================

* Product Page: https://www.creative-tim.com/product/paper-kit-react

* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/paper-kit-react/blob/main/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";

// reactstrap components

// core components
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import IndexHeader from "components/Headers/IndexHeader.js";
import DemoFooter from "components/Footers/DemoFooter.js";

// index sections
import SectionButtons from "views/index-sections/SectionIntroduction.js";
import SectionNavbars from "views/index-sections/SectionNavbars.js";
import SectionVideoCarousel from "views/index-sections/SectionVideoCarousel.js";
import SectionCollection from "views/index-sections/SectionCollection.js";
import SectionJavaScript from "views/index-sections/SectionJavaScript.js";
import SectionCarousel from "views/index-sections/SectionCarousel.js";
import SectionNucleoIcons from "views/index-sections/SectionNucleoIcons.js";
import SectionAbout from "views/index-sections/SectionAbout.js";
import SectionLogin from "views/index-sections/SectionLogin.js";
import SectionExamples from "views/index-sections/SectionExamples.js";
import SectionDownload from "views/index-sections/SectionDownload.js";
import {isMobile} from 'react-device-detect';




function Index() {
  document.documentElement.classList.remove("nav-open");
  React.useEffect(() => {
    document.body.classList.add("index");
    return function cleanup() {
      document.body.classList.remove("index");
    };
  });

  if (isMobile) {
    return (
        <>
          <IndexNavbar />
          <IndexHeader />
          <div className="main">
            <SectionButtons />
            <SectionCarousel />
            <SectionAbout />
            <DemoFooter />
          </div>
        </>
    );
  }

  return (
    <>
      <IndexNavbar />
      <IndexHeader />
      <div className="main">
        <SectionButtons />
        <SectionVideoCarousel />
        <SectionCollection />
        <SectionAbout />
        <DemoFooter />
      </div>
    </>
  );
}

export default Index;
